import { NavLink } from "react-router-dom";
import { MdGroups } from "react-icons/md";
const InfoCardApp = (props) => {
  return (
    <>
      <div className="col-3">
        <NavLink to="/hr/organizationchart">
          <div
            className=" dashbaord_imfo_card"
            style={{ backgroundColor: props.backgroundcolor }}
          >
            <div className="row">
              <div className="col-3 dashbaord_imfo_card_icon_col_div">
                <div className="dashbaord_imfo_card_icon_div">
                  <MdGroups />
                </div>
              </div>
              <div className="col-9">
                <div
                  className="dashbaord_imfo_card_text"
                  style={{ color: props.textcolor }}
                >
                  <h4>{prop.title}</h4>
                  <p>{prop.date}</p>
                </div>
              </div>
            </div>
          </div>
        </NavLink>
      </div>
    </>
  );
};
export default InfoCardApp;
